    TResult? Function(WrongPassword value)? invalidEmailAndPasswordCombination,
    TResult? Function(_Unexpected value)? unexpected,
    TResult? Function(_ServerError value)? serverError,
    TResult? Function(LogoutFailed value)? logoutFailed,
  }) {
    return logoutFailed?.call(this);
  }

  @override
  @optionalTypeArgs
  TResult maybeMap<TResult extends Object?>({
    TResult Function(InvalidEmail value)? invalidEmail,
    TResult Function(UserDisabled value)? userDisable,
    TResult Function(EmailAlreadyInUse value)? emailAlreadyInUse,
    TResult Function(OperationNotAllowed value)? operationNotAllowed,
    TResult Function(WeakPassword value)? weakPassword,
    TResult Function(UserNotFound value)? userNotFound,
    TResult Function(WrongPassword value)? invalidEmailAndPasswordCombination,
    TResult Function(_Unexpected value)? unexpected,
    TResult Function(_ServerError value)? serverError,
    TResult Function(LogoutFailed value)? logoutFailed,
    required TResult orElse(),
  }) {
    if (logoutFailed != null) {
      return logoutFailed(this);
    }
    return orElse();
  }
}

abstract class LogoutFailed implements AuthFailure {
  const factory LogoutFailed() = _$LogoutFailed;
}
